import React, {Component} from 'react';
import {Grid, Cell, Footer, FooterSection, FooterLinkList} from 'react-mdl';
import TypeOut from 'react-typeout';

const words = ['programming', 'outdoors', 'creating small ventures', 'learning from failure'];

var ReactRotatingText = require('react-rotating-text');


class Landing extends Component {
  render(){
    return(
      <div>
          <div className="contact-body">
        <Grid className="contact-grid">
          <Cell col={6}>
          <h3 className="aboutme-side">Hello! my name is Harris Schrick.<br/>
              I am a computer science student at Kansas State University in the college of Engineering.<br/>
              Some passions of mine are <br/><ReactRotatingText items={['programming.', 'the great outdoors.', 'creating small ventures.','reading documents.', 'learning from failure.']} /><br/>
              This website is a place for me to update about work that I am doing inside and outside of class.<br/>
              Feel free to look around and contact me at any time I will reply within one hour!</h3>
          </Cell>

        </Grid>
      </div>







          <div className="social-links">


      {/*Linkedin icon*/}
      <a href="https://www.linkedin.com/in/harris-schrick-b2a447179/" rel="noopener noreferrer" target="_blank">
      <i className="fa fa-linkedin-square" aria-hidden="true" />
      </a>

      {/*Github icon*/}
      <a href="https://github.com/hschrick" rel="noopener noreferrer" target="_blank">
      <i className="fa fa-github-square" aria-hidden="true" />
      </a>

    {/*youtube icon*/}
      <a href="https://www.youtube.com/channel/UCEuzmd8T99z3zrJAvm_lyFg?view_as=subscriber" rel="noopener noreferrer" target="_blank" onclick="Warn()">
      <i className="fa fa-youtube-square" aria-hidden="true" />
      </a>

    {/*slack icon*/}
      <a href="https://twitter.com/harris_schrick" rel="noopener noreferrer" target="_blank">
      <i className="fa fa-twitter-square" aria-hidden="true" />
      </a>


          </div>
          </div>

    )
  }
}

export default Landing;
